import React,{useState,useEffect} from 'react' ;

function Header(){
    const[head,setHead]=useState([]);
    useEffect =>(()=>{fetch('https://api.kanye.rest/')
    .then((response) => response.json())
    .then((data)=> {
        setHead(data.quote);
       
    })
    .catch((err) => {
       console.log(err.message);
    }); 
});



    return <header>
        <button onClick={()=>setHead()}>Refresh</button>
        <h1>{head}</h1>
    </header>
}

export default Header
